import { gql } from '@apollo/client';

export const ME = gql`
    query {
        me {
            id
            username
            email
            roles
            createdAt
        }
    }
`;

export const QUERY_USERS = gql`
    query {
        users {
            id
            username
            email
            roles
            createdAt
        }
    }
`;

export const QUERY_FACTORIES = gql`
    query {
        Factories {
            id
            factoryName
            productsMe {
                id
                productName
            }
            receivedProducts {
                productName
                factoryName {
                    factoryName
                    receivedProducts {
                        productName
                        factoryName {
                            factoryName
                        }
                    }
                }
            }
        }
    }
`;
export const QUERY_TIERS = gql`
    query {
        Tiers {
            id
            industrialEstate
            businessType
            companyName
            description
            address
            phoneNumber
            FAX
            Email
        }
    }
`;
